import React from 'react';
import ReactDOM from 'react-dom/client';

import {sum,sub,mul,div} from './App';


const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <>
    <ol>
      <li> The sum of two nos are {add(4,6)}</li>
      <li> The sum of two nos are {sub(4,6)}</li>
      <li> The sum of two nos are {mul(4,6)}</li>
      <li> The sum of two nos are {div(4,6)}</li>
    </ol>
  </>
);
